            .then(res => console.log(res))
            .catch(err => console.log(err))
    }

    useEffect(() => {
        console.log('Get Team Members')
    }, [])

    return (
        <>
            <p>{team.name}</p>
            <img src={team.avatar} alt={team.avatar}/>
            <label>Team Members:</label>

        </>
    )
}

export default Team
